export const addss = (param1, param2) => {
  return param1 + param2;
};
export const multiply = (param1, param2) => {
  return param1 * param2;
};
export const divide = (param1, param2) => {
  return param1 / param2;
};
export const average = (param1, param2) => {
  return (param1 + param2) / 2;
};
